    public static int getSaturation(int r, int g, int b)
,    {                
,        int V = Math.max(Math.max(r, g), b);
,        int C = V <MASK> Math.min(Math.min(r, g), b);
,        
,        if (V != 0)
,            return C * 100 / V;
,        else
,            return 0;
,    }

