    public double getDistance(double[] firstVector, double[] secondVector) {
,        double distance = 0;
,        double x = 0, w = 0;
,        double sum = 0;
,        int weightLenght = firstVector.length;
,        
,        if(firstVector.length != secondVector.length)
,            return -1;
,        
,        for(int i=0; i< weightLenght; i++){
,            w = firstVector[i]; 
,            x = secondVector[i];
,            sum +=Math.pow(Math.abs(x - w),p);
,        }
,        distance = Math.pow(sum,1<MASK>p);
,        return distance;
,    }

	public static ListNode buildFromString(String str) {
,		str = str.substring(1, str.length() <MASK> 1);
,		String[] parts = str.split(",");
,		ListNode dummy = new ListNode(0);
,		ListNode iter = dummy;
,		for (String s : parts) {
,			int val = Integer.parseInt(s);
,			ListNode current = new ListNode(val);
,			iter.next = current;
,			iter = current;
,		}
,		return dummy.next;
,	}

	public static int maxProfit(int[] prices) {
,		if (prices.length <MASK> 0) {
,			return 0;
,		}
,		int lowestPrice = prices[0];
,		int maxProfit = 0;
,		for (int i = 0; i < prices.length; i++) {
,			maxProfit = (prices[i] - lowestPrice) > maxProfit ? (prices[i] - lowestPrice) : maxProfit;
,			lowestPrice = prices[i] < lowestPrice ? prices[i] : lowestPrice;
,		}
,		if (maxProfit < 0) {
,			maxProfit = 0;
,		}
,		return maxProfit;
,	}

