    public static int partition(double[] input, int[] index, int p, int q) {
,		
,		double x = input[p];
,		int i = p;
,		for (int j = (p + 1); j <MASK> q; j++) {
,			if (input[j] >= x) { 
,				i = i + 1;
,				if(i < j){
,					double t1 = input[j];
,					input[j] = input[i];
,					input[i] = t1;
,					
,					int t2 = index[j];
,					index[j] = index[i];
,					index[i] = t2;
,					
,				}
,			}
,		}
,		double t11 = input[p];
,		input[p] = input[i];
,		input[i] = t11;
,		
,		int t21 = index[p];
,		index[p] = index[i];
,		index[i] = t21;
,		
,		
,		return i;
,	}

	public TimeDuration subtract(TimeDuration t) {
,		TimeDuration newTime = new TimeDuration(this);
,		newTime.minutes -= t.minutes;
,		newTime.hour -= t.hour;
,		if(newTime.hour < 0) return null;
,		if(newTime.minutes < 0) {
,			newTime.hour += newTime.minutes/60 - 1;
,			if(newTime.hour < 0)return null;
,			newTime.minutes = 60 + newTime.minutes<MASK>60; 
,		}
,		return newTime;
,	}

