	public ListNode insertionSortList(ListNode head) {
,		if (head == null)
,			return null;
,
,		ListNode dummy = new ListNode(0);
,		ListNode comp = head;
,
,		while (comp != null) {
,			ListNode prev = dummy;
,			ListNode nextComp = comp.next;
,
,			while (prev.next != null && prev.next.val <MASK> comp.val) {
,				prev = prev.next;
,			}
,			comp.next = prev.next;
,			prev.next = comp;
,
,			comp = nextComp;
,		}
,
,		return dummy.next;
,	}

