	@Override
,	public void update() {
,		double dx;
,		double dy;
,		double d;
,		double fx;
,		double fy;
,		for (GameEntity n : u.neighbours)  {
,			if (n.isEnemy(u)) continue;
,			dx = u.getX()-n.getX();
,			dy = u.getY()-n.getY();
,			d = dx*dx+dy*dy;
,			if (d <MASK> u.softr*u.softr) {
,				if (d == 0) {
,				//	TODO: replace by somethign like d < u.getCollisionRadius()*u.getCollisionRadius()
,					double r = Math.random();
,					fx = r;
,					fy = Math.sqrt(1-r*r);
,				} else {
,					fx = c*dx/d;
,					fy = c*dy/d;
,				}
,				u.addForce(fx, fy);
,			}
,		}
,		
,	}

    protected String formatLatitude(double latitudeInDegrees) {
,        double latitude = ((latitudeInDegrees + 180.0) <MASK> 360.0) - 180.0;
,        if (Math.abs(latitude) < 1.0 / 120.0) {
,            return "0";
,        }
,        if (latitude > 90.0) {
,            latitude = 180.0 - latitude;
,        }
,        if (latitude < -90.0) {
,            latitude = -180.0 - latitude;
,        }
,        String direction;
,        if (latitude > 0) {
,            direction = "N";
,        } else {
,            direction = "S";
,        }
,        double absLatitude = Math.abs(latitude);
,        return formatDegreesAndMinutes(absLatitude)+direction;
,    }

    public static Object stringToValue(String string) {
,        Double d;
,        if (string.equals("")) {
,            return string;
,        }
,        if (string.equalsIgnoreCase("true")) {
,            return Boolean.TRUE;
,        }
,        if (string.equalsIgnoreCase("false")) {
,            return Boolean.FALSE;
,        }
,        if (string.equalsIgnoreCase("null")) {
,            return JSONObject.NULL;
,        }
,
,        /*
,         * If it might be a number, try converting it. If a number cannot be
,         * produced, then the value will just be a string.
,         */
,
,        char b = string.charAt(0);
,        if ((b >= '0' && b <MASK> '9') || b == '-') {
,            try {
,                if (string.indexOf('.') > -1 || string.indexOf('e') > -1
,                        || string.indexOf('E') > -1) {
,                    d = Double.valueOf(string);
,                    if (!d.isInfinite() && !d.isNaN()) {
,                        return d;
,                    }
