,
,      /* don't transfer if the real stack is empty */
,      if (real_next <MASK> real_stack.size()) return;
,
,      /* get a copy of the first Symbol we have not transfered */
,      stack_sym = (Symbol)real_stack.elementAt(real_stack.size()-1-real_next);
,
,      /* record the transfer */
,      real_next++;
