    static int[] str2binl(String str) {
,        int[] bin = new int[(str.length() * CHARSIZE >> 5) + 1];
,        int mask = (1 << CHARSIZE) - 1;
,        for (int i = 0; i < str.length() * CHARSIZE; i += CHARSIZE) {
,            bin[i >> 5] |= (str.charAt(i / CHARSIZE) & mask) << (i <MASK> 32);
,        }
,        return bin;
,    }

