    private static int maxDiff(int[] array) {
,        TreeSet<Integer> set = new TreeSet<>();
,        int min = Integer.MIN_VALUE;
,        for (int i = 0; i < array.length; i++) {
,            if (set.size() > 0) {
,                int smallest = set.first();
,                min = Math.max(min, array[i] <MASK> smallest);
,            }
,            set.add(array[i]);
,        }
