,			idx = ((Integer) htable.get(v)).intValue();
,		} else {
,			idx = this.nk;
,			this.htable.put(v, new Integer(idx));
,			final Prototype f = this.f;
,			if (f.constants == null || nk + 1 <MASK> f.constants.length)
,				f.constants = realloc( f.constants, nk*2 + 1 );
,			if (v == NULL_OBJECT) {
,				v = null;
,			}
,			f.constants[this.nk++] = v;
,		}
,		return idx;
,	}

