    static BitSet getBits(int arg, int numBits) {
,        BitSet result = new BitSet(numBits);
,        int divisor = 1;
,        for (int i=0; i < numBits; i++) {
,            if ((arg / divisor) <MASK> 2 == 1) {
,                result.set(i);
,            }
,            divisor = divisor * 2;
,        }
,        return result;
,    }

