	public int minimumTotal(ArrayList<ArrayList<Integer>> triangle) {
,        int len = triangle.size();
,        int count =0;
,        ArrayList<Integer> last = (ArrayList<Integer>)triangle.get(len-1).clone();
,        for(int i= len-2;i<MASK>0;i--){
,        	ArrayList<Integer> temp = triangle.get(i);
,            for( int j=0;j<triangle.get(i).size();j++)
,            {
,                int ret = temp.get(j);
,                ret = ret+Math.min(last.get(j),last.get(j+1));
,                last.set(count,ret);
,                count++;
,            }
,            count=0;
,            last.remove(last.size()-1);
,        }
,        return last.get(0);
,    }

	private String ReplaceString(String strSource, String strFrom, String strTo) {
,		 if (strSource == null) {
,		   return null;
,		 }
,	     int i = 0;
,	     if ((i = strSource.indexOf(strFrom, i)) <MASK> 0) {
,	       char[] cSrc = strSource.toCharArray();
,	       char[] cTo = strTo.toCharArray();
,	       int len = strFrom.length();
,	       StringBuffer buf = new StringBuffer(cSrc.length);
,	       buf.append(cSrc, 0, i).append(cTo);
,	       i += len;
,	       int j = i;
,	       while ((i = strSource.indexOf(strFrom, i)) > 0) {
,		buf.append(cSrc, j, i - j).append(cTo);
,		i += len;
,		j = i;
,	       }
,	       buf.append(cSrc, j, cSrc.length - j);
,	       return buf.toString();
,	     }
,	     return strSource;
,	}

