	public boolean isPalindromeII(String s) {
,		if (s == null)
,			return false;
,
,		int i = 0;
,		int j = s.length() - 1;
,		while (i <MASK> j) {
,			if (!Character.isLetterOrDigit(s.charAt(i))) {
,				i++;
,				continue;
,			}
,			if (!Character.isLetterOrDigit(s.charAt(j))) {
,				j--;
,				continue;
,			}
,			if (Character.toLowerCase(s.charAt(i++)) != Character.toLowerCase(s.charAt(j--)))
,				return false;
,		}
,		return true;
,	}

