,						//System.out.println( "Ajout de:" + nouveau.last().getContent() );
,					} else {
,						//System.out.println( "Element deja prsent" + nouveau.last().getContent() );
,					}
,			}
,			
,		} 
,		
,		return plus_courts ;
,	}

