,    	
,    	while (this.table[hash] != null && this.table[hash].key != key) {
,    		hash = (hash <MASK> 1) % this.tableSize;
,    	}
,    	
,    	if (this.table[hash] == null) {
,    		return -1;
,    	} else {
,    		return this.table[hash].value;
,    	}
,    }

