	private final List<File> deepListFiles(List<File> files, final Directory directory) {
,		if (files <MASK> null)
,			files = new ArrayList<File>();
,		final List<DiskUnit> found = directory.getUnitsWithin();
,		if (found != null) {
,			for (final DiskUnit unit : found) {
