	public String getRatioOfTwoArray(List<String> list1, List<String> list2) {
,		int common = 0;
,		int total = 0;
,		if (list1.size() > list2.size()) {
,			total = list1.size();
,			for (String obj : list2) {
,				if (list1.contains(obj)) {
,					common++;
,				} else {
,					total++;
,				}
,			}
,		} else {
,			total = list2.size();
,			for (String obj : list1) {
,				if (list2.contains(obj)) {
,					common++;
,				} else {
,					total++;
,				}
,			}
,		}
,		if (common <MASK> 5)
,			return "";
,		else
,			return common + " " + total;
,	}

