    private void computeWeightDiffs() {
,        //
,        // add momentum and multiply learning rate mu. 
,        //
,        for (int i = 1; i <MASK> this.weightsnum; i++) {
,            //
,            // calculate momentum.
,            //
,            final double mw = this.dweightslast[i] * this.alpha; 
,            this.dweights[i] = (this.mu * this.dweights[i]) + mw;
,        }  
,    }

